import styled from "styled-components";


export const Container = styled.section`

    background-color: gray;
    display: grid;
    grid-template-columns: repeat(3, 1fr);
    margin: auto;
    width: 85vw;
    height: 20vh;
    margin-top: -3rem;

    & div {
        background: var(--background);
        max-width: 1080px;
        width: 80%;
    }

    .header {
        display: flex;
        justify-content: sp;
    }
`
